void draw_charater(int x_location, int y_location){
  for(int i=0; i<17; i++){
    for(int j=0; j<16; j++){
      if(character_color[i][j]!=T)
        plot_pixel(x_location+j, y_location+i, character_color[i][j]);
    }
  }
}
void erase_character(int character_x, int character_y){
  for(int i=character_x; i < character_x + 16; i++){
    for(int j=character_y; j < character_y + 17; j++){
      if(i < 320 && i >= 0 && j < 240 && j >=0){
        plot_pixel(i,j,background_low[i][j]);
      }
    }
  }
}

void erase_health_bar(int hp){
	int hp_proportion = hp*280/1000;
	for(int i=20+hp_proportion; i<300; i++){
		for(int j=40; j<60; j++){
			plot_pixel(i, j, background_low[i][j]);
		}
	}
}

void erase_magic_attack(int magic_x,int magic_y){
	for(int i=0; i <  25; i++){
		for(int j=0; j < 25; j++){
			if(magic_x+i < 320 && magic_x+i >= 0 && magic_y+j >= 0 && magic_y+j < 240){
		  		plot_pixel(magic_x+i,magic_y+j,background_low[magic_x+i][magic_y+j]);
			}
		}
	}
}

void erase_fireball(int fire_x, int fire_y){
	for(int i=0; i < 50; i++){
		for(int j=0; j < 50; j++){
			if(fire_x+i < 320 && fire_x+i >= 0 && fire_y+j >= 0 && fire_y+j < 240){
		  		plot_pixel(fire_x+i,fire_y+j,background_low[fire_x+i][fire_y+j]);
			}
		}
	}
}

void erase_laser(int laser_x_loc,int laser_y_loc,int laser_dir, bool diag){
	if(!diag){
		for(int i=laser_x_loc; i < laser_x_loc+25; i++){
			for(int j=laser_y_loc; j < laser_y_loc+25; j++){
				if(i < 320 && i >= 0 && j >= 0 && j < 240){
					plot_pixel(i,j,background_low[i][j]);
				}
			}
		}
	}else{
		for(int i=laser_x_loc; i < laser_x_loc+25; i++){
			for(int j=laser_y_loc; j < laser_y_loc+25; j++){
				if(i < 320 && i >= 0 && j >= 0 && j < 240){
					plot_pixel(i,j,background_low[i][j]);
				}
			}
		}
	}
	
}

void draw_laser(int x_location, int y_location, int direction){
  if(direction == 0){
    for(int i=0; i < 25; i++){
      for(int j=0; j < 25; j++){
        int index = (i*25 + j)*2;
        short int color = (short int)((laser_temp[index+1] << 8) & (0xFF00)) | (short int)(laser_temp[index] & 0xFF);
         if(color != 0x0000 && x_location+j >= 0 && x_location+j < 320 && y_location+i >= 0 && y_location+i < 240)
		  plot_pixel(x_location+j, y_location+i, color);
      }
    }
  }else if(direction == 1){
    for(int i=25; i >= 0; i--){
      for(int j=25; j >= 0; j--){
        int index = (i*25 + j)*2;
        short int color = (short int)((laser_temp[index+1] << 8) & (0xFF00)) | (short int)(laser_temp[index] & 0xFF);
         if(color != 0x0000 && x_location+25-i >= 0 && x_location+25-i < 320 && y_location+25-j >= 0 && y_location+25-j < 240)
		  plot_pixel(x_location+25-i, y_location+25-j, color);
      }
    }
  }else if(direction == 2){
    for(int i=25; i >= 0; i--){
      for(int j=0; j < 25; j++){
        int index = (i*25 + j)*2;
        short int color = (short int)((laser_temp[index+1] << 8) & (0xFF00)) | (short int)(laser_temp[index] & 0xFF);
         if(color != 0x0000 && x_location+j >= 0 && x_location+j < 320 && y_location+25-i >= 0 && y_location+25-i < 240)
		  plot_pixel(x_location+j, y_location+25-i, color);
      }
    }
  }else if(direction == 3){
    for(int i=0; i < 25; i++){
      for(int j=25; j >= 0; j--){
        int index = (i*25 + j)*2;
        short int color = (short int)((laser_temp[index+1] << 8) & (0xFF00)) | (short int)(laser_temp[index] & 0xFF);
         if(color != 0x0000 && x_location+i >= 0 && x_location+i < 320 && y_location+25-j >= 0 && y_location+25-j < 240)
		  plot_pixel(x_location+i, y_location+25-j, color);
      }
    }
  }
}

